import React, { useEffect, useState } from 'react';
import { Line, Bar } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  LineElement,
  BarElement,
  CategoryScale,
  LinearScale,
  PointElement
} from 'chart.js';
import './MonitorPage.css';

ChartJS.register(LineElement, BarElement, CategoryScale, LinearScale, PointElement);

export default function MonitorPage() {
  const [data, setData] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const token = localStorage.getItem('token');

    fetch('/api/monitor', {
      headers: { 'Authorization': `Bearer ${token}` }
    })
      .then(res => {
        if (!res.ok) throw new Error(`Error ${res.status}`);
        return res.json();
      })
      .then(setData)
      .catch(() => setError('No se pudieron cargar las métricas.'));
  }, []);

  if (error) return <p className="monitor-error">{error}</p>;
  if (!data) return <div className="monitor-loading">Cargando métricas...</div>;

  return (
    <div className="monitor-container">
      <h1 className="monitor-title">Dashboard de Monitoreo MySQL</h1>

      {/* Resumen de métricas */}
      <div className="cards-grid">
        <div className="card">
          <h3>Conexiones activas</h3>
          <p className="value">{data.threadsConnected}</p>
        </div>
        <div className="card">
          <h3>Consultas totales</h3>
          <p className="value">{data.totalQueries}</p>
        </div>
        <div className="card">
          <h3>Consultas lentas</h3>
          <p className="value">{data.slowQueries}</p>
        </div>
        <div className="card">
          <h3>Tiempo activo</h3>
          <p className="value">{data.uptime}s</p>
        </div>
      </div>

      {/* Gráficos */}
      <div className="charts-grid">
        <div className="chart-card">
          <h3>Bytes Enviados vs Recibidos</h3>
          <Bar
            data={{
              labels: ['Enviados', 'Recibidos'],
              datasets: [{ label: 'Bytes', data: [data.bytesSent, data.bytesReceived], borderWidth: 1 }]
            }}
            options={{ maintainAspectRatio: false }}
          />
        </div>
        <div className="chart-card">
          <h3>Top 5 Consultas</h3>
          <Line
            data={{
              labels: data.topQueries.map((_, i) => `#${i + 1}`),
              datasets: [{ label: 'Veces ejecutada', data: data.topQueries.map(q => q.count), fill: false, tension: 0.3 }]
            }}
            options={{ maintainAspectRatio: false }}
          />
        </div>
      </div>

      {/* Lista detallada */}
      <section className="top-queries-list">
        <h2>Detalle de las 5 Consultas más frecuentes</h2>
        <ul>
          {data.topQueries.map((q, i) => (
            <li key={i}>
              <span className="count">{q.count}x</span>
              <code className="query">{q.query}</code>
            </li>
          ))}
        </ul>
      </section>
    </div>
  );
}
